        description={categories[1].description} />
      <HomePage title={categories[2].title}
        description={categories[2].description} />
      <HomePage title={categories[3].title}
        description={categories[3].description} />
      <HomePage title={categories[4].title}
        description={categories[4].description} />
      <HomePage title={categories[5].title}
        description={categories[5].description} />
      <HomePage title={categories[6].title}
        description={categories[6].description} />
      <HomePage title={categories[7].title}
        description={categories[7].description} />
      <HomePage title={categories[8].title}
        description={categories[8].description} />
    </div>
  );
}

export default App;
